import React from "react";
import styled, { ThemeProvider } from "styled-components";
import { Timer } from "arclight-react";

const _Timer = styled.div`
  position: absolute;
  top: 35%;
  ${(props) => (props.team_active === 1 ? "left: 100px" : "right: 100px")};
  transform: translate(-50%, -35%);
`;

export default class _ extends React.Component {
  render() {
    return (
      <ThemeProvider theme={{}}>
        <_Timer team_active={this.props.STATE.team_active}>
          <Timer
            theme={this.props.STATE.config.THEME}
            isPlaying={false}
            size={100}
            seconds={60}
            crit={7}
            strokeWidth={4}
            onComplete={() => console.log("Timer Finished")}
          />
        </_Timer>
      </ThemeProvider>
    );
  }
}
